// Create an images object to store all image URLs
const images = {
  loginBg: 'https://images.unsplash.com/photo-1486312338219-ce68d2c6f44d?w=800&auto=format&fit=crop',
  companyLogos: [
    'https://via.placeholder.com/150?text=Company1',
    'https://via.placeholder.com/150?text=Company2',
    'https://via.placeholder.com/150?text=Company3',
    'https://via.placeholder.com/150?text=Company4'
  ],
  defaultAvatar: 'https://via.placeholder.com/40?text=User'
};

export default images;
